  FaTwitter,
  FaLinkedin,
} from "react-icons/fa";

function Footer() {
  return (
    <React.Fragment>
      <div className="container-fluid bg-black p-5 text-white">
        <div className="row">
          <div className="col-md-1 d-flex flex-column mb-3">
              <FaHome
                size={20}
                style={{ color: "white"}}
              />
              <FaPhoneVolume
                size={20}
                style={{
                  color: "white"
                }}
              />
              <FaMailBulk
                size={20}
                style={{ color: "white"}}
              />
            {/* <div>
              <FaHome
                size={20}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              West Melbourne,
              <br />
              <span className="p-5">Florida.</span>
