              <FaPhoneVolume
                size={20}
                style={{
                  color: "white",
                  marginRight: "1.5rem",
                  marginBottom: "1rem",
                }}
              />
              321-405-4650
              <br />
              <FaMailBulk
                size={20}
                style={{ color: "white", marginRight: "1rem" }}
              />
              vanim2@gmail.com
            </div> */}
          </div>
          <div className="col-md-6 text-center">
            <p className="display3">Feel free to contact me on social media.</p>
            <div className="m-3">
              <FaFacebook
                size={30}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              <FaTwitter
                size={30}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              <FaMailBulk
                size={30}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              <FaLinkedin size={30} style={{ color: "white" }} />
            </div>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Footer;
